INSERT INTO `posts` (`postId`, `userId`, `title`, `text`, `usefulNumber`, `notusefulNumber`, `newId`, `datetime`, `status`, `productPhoto`, `price`) VALUES
(1, 1, 'First Post!', '<p>Hi!</p>', 0, 0, 0, '2019-05-31 21:14:54', -1, NULL, 0),
(2, 1, 'DİKKAT! -- Lütfen Okuyunuz!', '<p>Merhaba! Ben bu sitenin yöneticilerinden biriyim. Bu site içerisinde teknik sıkıntı olursa lütfen bana ulaşınız! Bana ulaşmak için aşağıdaki bağlantıyı kullanabilirsiniz!</p>', 0, 0, 0, '2019-05-31 21:22:30', -1, NULL, 0),
(3, 1, 'DİKKAT! -- Bunu okumanızda fayda olabilir!', '<p><strong>Merhaba! </strong>Öncelikle sitemize <em>hoşgeldiniz</em>!&nbsp;</p><p>Sitemizin içinde bulunduğunuz sürelerde yaşanılan sıkıntılarda bizimle iletişime geçmekten çekinmeyiniz!&nbsp;</p><p>Bizimle iletişime geçebilmeniz için şuanda hiçbir yol yok! Maalesef! Umarım bugün bu sıkıntıyı gidermek için bir sayfa oluşturabilirim.</p><p>Ama yinede acil durumda benimle iletişime geçebilmeniz için bir önceki postta size bir link bıraktım.&nbsp;</p><p>İyi günler!</p><p><img src=\"blob:http://localhost/b780b1b7-8fd3-4b38-9a2f-aa2d4dd8c493\" style=\"width: 300px;\" class=\"fr-fic fr-dib fr-draggable\"></p><p>Semih</p><p><br></p>', 0, 0, 0, '2019-06-01 05:51:37', -1, NULL, 0),
(4, 1, 'Çocuklarda görülen 5 büyük özellik', '<p>Bugün profil güncelleme kısmı yapıldı. Ayrıca resim değiştirme kısmı da tamamlandı denilebilir.</p>', 0, 0, 0, '2019-06-04 01:12:15', -1, NULL, 0),
(5, 1, 'Ebeveynler için tavsiye edilenler', '<p><strong>Yapılacaklar :&nbsp;</strong></p><ol><li>Postlar için like-dislike buttonları&nbsp;</li><li>Post düzenleme&nbsp;</li><li>Yorumlara ve postlara spam atabilme</li><li>Yorumları ve postları silebilme</li><li>Spamları adminlerin kontrol edebilmesi için bir bölüm</li></ol>', 0, 0, 0, '2019-06-04 02:34:32', 0, NULL, 0),
(6, 2, 'Çocukalrın elektronik cihazlarla imtihanı', '<p><em>Çocuklarınızı elektronik cihazlarla etkileşim halinde <u><strong>iken dikkat ediniz.</strong></u> Saatler belirleyiniz. Mümkünse hiç ulaşmamasını sağlayınız.</em></p>', 0, 0, 0, '2019-06-04 04:47:37', 0, NULL, 0),
(7, 1, 'Okuduğunuza pişman olmayacağınız bilgiler', '<p>Bugün spamlanan postlar, yorumlar ve yorumların cevaplarının bir listede gösterilmesini &nbsp;ve bu liste aracılığıyla yetkili kişilerin bu postları ve yorumları yayından kaldırabilmesi için gerekli kısım oluşturuldu.</p>', 0, 0, 0, '2019-06-05 00:17:35', -1, NULL, 0),
(9, 1, 'Anne-Baba-Çocuk arasında Hatalı iletişimler', '<p>Anne-babaların çocuklarına korku silahını çevirmeksizin sorumlu, işbirliğine yatkın, kendi kendini disipline eden, yapıcı ve yaratıcı bireyler yetiştirebilmeleri, ancak onlarla kuracakları sağlıklı iletişim ortamına bağlıdır. Buda, anne-babaların susmayı öğrenip, çocuklarını dinlemeleri ile mümkündür.</p><p><strong>Hatalı iletişim yöntemleri :</strong></p><ol><li><strong>&nbsp;</strong><em><strong>Suçlama (Sen her zaman konuşursun zaten).&nbsp;</strong></em></li><li><em><strong>Emir (Hemen yerine otur).&nbsp;</strong></em></li><li><em><strong>Eleştirme (Daha iyisini yapmalısın)&nbsp;</strong></em></li><li><em><strong>Uyarma (Son kez hatırlatıyorum)&nbsp;</strong></em></li><li><strong><em>Utandırma (Şımarık çocuk)</em></strong></li></ol><p><br></p>', 0, 0, 0, '2019-06-05 05:10:28', -1, NULL, 0),
(10, 7, 'Başarılı Anne-Baba-Çocuk İlişkisinin Koşulları :', '<p><strong><em>Anne-babalar</em></strong>, öncelikle çocuklarını tanımalı; onları, ilgi ve yetenekleri doğrultusunda yönlendirilmelidirler. Bu konuda, kendi tutku ve arzularına göre değerlendirme yapmamalıdırlar.&nbsp;</p><p><strong><em>Anne-babalar,</em></strong> çocuklarındaki güven duygusunu pekiştirmek üzere, onları yapıcı ve faal kılacak bir ortam hazırlamalıdırlar. Ancak, bu ortamı hazırlarken, verecekleri görevin, çocuğun yetenek ve kapasitesini aşmamasına özen göstermelidirler.&nbsp;</p><p>Anne- babalar, çocuk için önemli besinin, <u><em><strong>“sevgi”</strong></em></u> ve <em><u><strong>“sevecenlik”</strong></u></em> olduğunu bilerek, çocuklarına yeterince ilgi ve sevgi göstermelidirler. Bu konuda aşırıya kaçmamaya özellikle dikkat etmelidirler.&nbsp;</p><p style=\"text-align: left;\"><strong><em><u>Uzm. Dr. Mert Uçar</u></em></strong></p>', 0, 0, 0, '2019-06-05 05:51:24', 0, NULL, 0),
(11, 7, 'Başarılı Anne-Baba-Çocuk İlişkisinin Koşulları :', '<p><strong><em>Anne-babalar</em></strong> çocuklarınıza sınavlarından dolayı aşırı strese sokmayın. Fazla stres yapıyorlarsa da stresden uzak olmalarına yardımcı olun. Stres iyi bir şey değildir.&nbsp;</p><p><strong><em>Anne-babalar,</em></strong> çocuklarındaki güven duygusunu pekiştirmek üzere, onları yapıcı ve faal kılacak bir ortam hazırlamalıdırlar. Ancak, bu ortamı hazırlarken, verecekleri görevin, çocuğun yetenek ve kapasitesini aşmamasına özen göstermelidirler.&nbsp;</p>', 0, 0, 0, '2019-06-05 05:51:53', 0, NULL, 0),
(12, 7, 'Anne-Baba-Çocuk arasında Hatalı iletişimler', '<p>Anne-babaların çocuklarına korku silahını çevirmeksizin sorumlu, işbirliğine yatkın, kendi kendini disipline eden, yapıcı ve yaratıcı bireyler yetiştirebilmeleri, ancak onlarla kuracakları sağlıklı iletişim ortamına bağlıdır. Buda, anne-babaların susmayı öğrenip, çocuklarını dinlemeleri ile mümkündür.</p><p><strong>Hatalı iletişim yöntemleri :</strong></p><ol><li><strong>&nbsp;</strong><em><strong>Suçlama (Sen her zaman konuşursun zaten).&nbsp;</strong></em></li><li><em><strong>Emir (Hemen yerine otur).&nbsp;</strong></em></li><li><em><strong>Eleştirme (Daha iyisini yapmalısın)&nbsp;</strong></em></li><li><em><strong>Uyarma (Son kez hatırlatıyorum)&nbsp;</strong></em></li><li><strong><em>Utandırma (Şımarık çocuk)</em></strong></li></ol><p><br></p>', 0, 0, 0, '2019-06-05 05:51:57', 0, NULL, 0),
(13, 1, 'Anneler dikkat! Bebek mamasını sakın buzdolabına koymayın', '<p>Anne sütünün bebek beslenmesinde ilk sırada olması gerektiğini belirten Çocuk Hastalıkları Uzmanı Doç. Dr. İlke <strong>Mungan Akın,&nbsp;</strong>\"Mama her zaman ikinci tercih olmalı. Aileler mamaları alırken ise kutuların deforme olmamış olmasına ve paketi açtıklarında kötü bir kokunun gelmemesine dikkat etmeliler\" dedi.Anne sütünün bebek beslenmesinde ilk sırada olması gerektiğini belirten Çocuk Hastalıkları Uzmanı <strong>Doç. Dr. İlke Mungan Akın,</strong> \"Mama her zaman ikinci tercih olmalı. Aileler mamaları alırken ise kutuların deforme olmamış olmasına ve paketi açtıklarında kötü bir kokunun gelmemesine dikkat etmeliler\" dedi.&nbsp;</p><p>&nbsp;<strong><em><u>Teşekkürler</u></em></strong></p>', 0, 0, 0, '2019-06-09 14:09:31', -1, NULL, 0),
(14, 1, 'Anne-babalar dikkat! Çocukları tehdit etmeye başladı', '<p>Geçtiğimiz yıl ortaya çıkan ve çocukların ölümüne neden olan “<a href=\"http://www.haber7.com/etiket/mavi+balina\" target=\"_blank\" title=\"Mavi Balina\">Mavi Balina</a>” ve “Mariam” dan sonra şimdi de son günlerde adından sıkça söz ettiren; büyük gözleri, uzun saçları ve sıra dışı görüntüsüyle korku filmi karakterini andıran&nbsp;<a href=\"http://www.haber7.com/etiket/momo\" target=\"_blank\" title=\"Momo\">Momo</a> adlı bir çizim, çocukları ve aileleri tehdit ediyor. İnternette video izlerken ekranda beliren bu ilginç yaratık, çocukların kendilerine zarar vermesine yönelik bazı direktifler veriyor. Bu emirlerin sonu ölüme kadar gidebiliyor. <br></p>', 0, 0, 0, '2019-06-14 00:33:03', -2, NULL, 0);

